import React from "react";
import { BrowserRouter } from "react-router-dom";

const Root = () => {
  return (
    <BrowserRouter>
      <div>
        <span>home</span>
        <span>about</span>
        <span>contact</span>
      </div>
    </BrowserRouter>
  );
};

export default Root;
